import { Navbar } from "./components/navbar";
import { Hero } from "./components/hero";
import { Card } from "./components/card";

export function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <Card
        rating={5.0}
        comments="(6)"
        country="USA"
        desc="Life Lessons with Katie Zaferes"
        cost='<span className="bold">From $136</span> / person'
      />
    </div>
  );
}
